import React from 'react'
import { useLocation } from 'react-router-dom'

const usePage = () => {
    let location = useLocation()
    let PAGE = `($id: ID = $location) {
        page(id: $id, idType: URI) {
            id
            link
            pageId
            uri
            title(format: RENDERED)
            content(format: RENDERED)
        }
        }`
    console.log(PAGE);
  return (
    <div>usePage</div>
  )
}

export default usePage
